import React from 'react';

function ChatbotIframe() {
  return (
    <div style={{ height: '100vh' }}>
      <iframe
        src="https://www.chatbase.co/chatbot-iframe/JyYtJdFLrGKZ9BWWOsiyC"
        width="100%"
        style={{ height: '100%', minHeight: '700px' }}
        frameBorder="0"
        title="Chatbot"
      ></iframe>
    </div>
  );
}

export default ChatbotIframe;
